import React from "react";
import './style.css';
import lisa from "./lisa.jpg";

function Grid() {
  return (
    <div class="grid-container">
      <div class="grid-item">
        <img src={lisa} alt="angrey lisa" />
      </div>
      <div class="grid-item">2</div>
    </div>
  )
}

export default Grid;
